function Movie({id, coverImg, title, summary, genres}) {
    return (
        <div id={id}>
            <img src={coverImg}></img>
            <h2>{title}</h2>
            <p>{summary}</p>
            <ul>
              {genres.map(genre => (
                <li>{genre}</li>
              ))}
            </ul>
            <hr />
            <br />
          </div>
    )
}

export default Movie
